(74, 'S32_3207', '1950\'s Chicago Surface Lines Streetcar', 'Trains', '26.72', 'This streetcar is a joy to see. It has 80 separate windows, electric wire guides, detailed interiors with seats, poles and drivers controls, rolling and turning wheel assemblies, plus authentic factory baked-enamel finishes (Green Hornet for Chicago and Cream and Crimson for Boston).'),
